import React, { useState } from 'react';
import { supabase } from '../config/supabase';
import { useNavigate } from 'react-router-dom';
import { Toast } from './common/Toast';

export function DrillDashboard() {
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [successMessage, setSuccessMessage] = useState('');
  const [showToast, setShowToast] = useState(false);
  const [toastType, setToastType] = useState('success');
  const [newDrill, setNewDrill] = useState({
    name: '',
    simple_name: '',
    purpose: '',
    influences: '',
    difficulty: '',
    skill_demands: '',
    equipment_requirements: '',
    equipment_alternatives: '',
    execution_requirements: '',
    regressions: '',
    progressions: '',
    plane: '',
    chain_type: '',
    stance: '',
    movement_types: '',
    region: '',
    joints: '',
    joint_actions: '',
    muscles: '',
    tendons: '',
    nervous_system: '',
    psychological: '',
    system_impact: '',
    notes: '',
    instructions: '',
    video_url: ''
  });
  const [textBlock, setTextBlock] = useState('');
  const [isInstructionsExpanded, setIsInstructionsExpanded] = useState(false);
  const navigate = useNavigate();

  const showErrorToast = (message) => {
    setError(message);
    setSuccessMessage(message);
    setToastType('error');
    setShowToast(true);
  };

  const showSuccessToast = (message) => {
    setSuccessMessage(message);
    setToastType('success');
    setShowToast(true);
  };

  async function addDrill(e) {
    e.preventDefault();

    if (!newDrill.name.trim()) {
      showErrorToast('Drill name is required');
      return;
    }

    try {
      setLoading(true);
      setError(null);

      // Clean the drill data - only include non-empty fields
      const cleanDrillData = {
        name: newDrill.name.trim(),
        simple_name: newDrill.simple_name.trim() || null,
        purpose: newDrill.purpose.trim() || null,
        influences: newDrill.influences.trim() || null,
        difficulty: newDrill.difficulty.trim() || null,
        skill_demands: newDrill.skill_demands.trim() || null,
        equipment_requirements: newDrill.equipment_requirements.trim() || null,
        equipment_alternatives: newDrill.equipment_alternatives.trim() || null,
        execution_requirements: newDrill.execution_requirements.trim() || null,
        regressions: newDrill.regressions.trim() || null,
        progressions: newDrill.progressions.trim() || null,
        plane: newDrill.plane.trim() || null,
        chain_type: newDrill.chain_type.trim() || null,
        stance: newDrill.stance.trim() || null,
        movement_types: newDrill.movement_types.trim() || null,
        region: newDrill.region.trim() || null,
        joints: newDrill.joints.trim() || null,
        joint_actions: newDrill.joint_actions.trim() || null,
        muscles: newDrill.muscles.trim() || null,
        tendons: newDrill.tendons.trim() || null,
        nervous_system: newDrill.nervous_system.trim() || null,
        psychological: newDrill.psychological.trim() || null,
        system_impact: newDrill.system_impact.trim() || null,
        notes: newDrill.notes.trim() || null,
        instructions: newDrill.instructions.trim() || null,
        video_url: newDrill.video_url.trim() || null
      };

      // Insert the drill into the drills table
      const { data, error } = await supabase
        .from('drills')
        .insert([cleanDrillData])
        .select();

      if (error) throw error;

      // Reset form fields
      setNewDrill({
        name: '',
        simple_name: '',
        purpose: '',
        influences: '',
        difficulty: '',
        skill_demands: '',
        equipment_requirements: '',
        equipment_alternatives: '',
        execution_requirements: '',
        regressions: '',
        progressions: '',
        plane: '',
        chain_type: '',
        stance: '',
        movement_types: '',
        region: '',
        joints: '',
        joint_actions: '',
        muscles: '',
        tendons: '',
        nervous_system: '',
        psychological: '',
        system_impact: '',
        notes: '',
        instructions: '',
        video_url: ''
      });
      setTextBlock('');

      // Show success message
      showSuccessToast('Drill added successfully');

      // Navigate to the drill library after a short delay
      setTimeout(() => {
        navigate('/library');
      }, 1500);
    } catch (err) {
      showErrorToast('Failed to add drill: ' + (err.message || 'Unknown error'));
      console.error('Error adding drill:', err);
    } finally {
      setLoading(false);
    }
  }

  const toggleInstructions = () => {
    setIsInstructionsExpanded(!isInstructionsExpanded);
  };

  function handleInputChange(e) {
    const { name, value } = e.target;
    setNewDrill({
      ...newDrill,
      [name]: value
    });
  }

  function parseTextBlock() {
    if (!textBlock.trim()) {
      showErrorToast('Please paste a drill block to parse');
      return;
    }

    try {
      const lines = textBlock.split('\n');
      const parsedDrill = { ...newDrill };

      console.log('Parsing drill block with lines:', lines);

      lines.forEach(line => {
        // Skip empty lines
        if (!line.trim()) return;

        // Find the colon to split the key and value
        const colonIndex = line.indexOf(':');
        if (colonIndex === -1) return; // Skip lines without colon

        const key = line.substring(0, colonIndex).trim();
        const value = line.substring(colonIndex + 1).trim();

        if (key && value) {
          const normalizedKey = key.toLowerCase().trim().replace(/\s+/g, '_');
          if (normalizedKey in parsedDrill) {
            // Clean up comma-separated lists
            let formattedValue = value;
            if (formattedValue.includes(',')) {
              formattedValue = formattedValue
                .split(',')
                .map(item => item.trim())
                .filter(item => item)
                .join(', ');
            }

            parsedDrill[normalizedKey] = formattedValue;
            console.log('Set value for:', normalizedKey, 'to:', formattedValue);
          }
        }
      });

      console.log('Final parsed drill:', parsedDrill);

      setNewDrill(parsedDrill);
      showSuccessToast('Drill block parsed successfully');
    } catch (err) {
      showErrorToast('Failed to parse drill block: ' + err.message);
      console.error('Error parsing drill block:', err);
    }
  }

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-6 text-orange-400">Add New Drill</h2>

      <Toast 
        message={successMessage} 
        isVisible={showToast} 
        onClose={() => setShowToast(false)} 
        type={toastType} 
      />

      <div className="mb-6">
        <h3 className="text-lg font-medium mb-2 text-blue-400">Paste Full Drill Block</h3>
        <textarea
          className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white h-40"
          value={textBlock}
          onChange={(e) => setTextBlock(e.target.value)}
          placeholder="Paste your drill block here (format: Key: Value, one per line)"
        />
        <button
          className="mt-2 bg-blue-600 hover:bg-blue-500 text-white px-4 py-2 rounded"
          onClick={parseTextBlock}
        >
          Parse Block
        </button>
      </div>

      <form onSubmit={addDrill} className="space-y-4">
        <div>
          <label className="block mb-2 text-gray-300">Name *</label>
          <input
            type="text"
            name="name"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.name}
            onChange={handleInputChange}
            required
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Simple Name</label>
          <input
            type="text"
            name="simple_name"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.simple_name}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Purpose</label>
          <input
            type="text"
            name="purpose"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.purpose}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Influences</label>
          <input
            type="text"
            name="influences"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.influences}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Difficulty</label>
          <input
            type="text"
            name="difficulty"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.difficulty}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Skill Demands</label>
          <input
            type="text"
            name="skill_demands"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.skill_demands}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Equipment Requirements</label>
          <input
            type="text"
            name="equipment_requirements"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.equipment_requirements}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Equipment Alternatives</label>
          <input
            type="text"
            name="equipment_alternatives"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.equipment_alternatives}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Execution Requirements</label>
          <input
            type="text"
            name="execution_requirements"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.execution_requirements}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Regressions</label>
          <input
            type="text"
            name="regressions"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.regressions}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Progressions</label>
          <input
            type="text"
            name="progressions"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.progressions}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Plane</label>
          <input
            type="text"
            name="plane"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.plane}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Chain Type</label>
          <input
            type="text"
            name="chain_type"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.chain_type}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Stance</label>
          <input
            type="text"
            name="stance"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.stance}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Movement Types</label>
          <input
            type="text"
            name="movement_types"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.movement_types}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Region</label>
          <input
            type="text"
            name="region"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.region}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Joints</label>
          <input
            type="text"
            name="joints"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.joints}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Joint Actions</label>
          <input
            type="text"
            name="joint_actions"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.joint_actions}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Muscles</label>
          <input
            type="text"
            name="muscles"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.muscles}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Tendons</label>
          <input
            type="text"
            name="tendons"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.tendons}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Nervous System</label>
          <input
            type="text"
            name="nervous_system"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.nervous_system}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Psychological</label>
          <input
            type="text"
            name="psychological"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.psychological}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">System Impact</label>
          <input
            type="text"
            name="system_impact"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.system_impact}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Video URL</label>
          <input
            type="text"
            name="video_url"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.video_url}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Notes</label>
          <textarea
            name="notes"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white h-24"
            value={newDrill.notes}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <div className="flex justify-between items-center mb-2">
            <label className="text-gray-300">Instructions</label>
            <button
              onClick={toggleInstructions}
              className="text-sm text-blue-400 hover:text-blue-300"
            >
              {isInstructionsExpanded ? 'Collapse' : 'Expand'}
            </button>
          </div>
          <textarea
            name="instructions"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.instructions}
            onChange={handleInputChange}
            style={{ height: isInstructionsExpanded ? '200px' : '100px' }}
          />
        </div>

        <button
          type="submit"
          className="w-full bg-green-600 hover:bg-green-500 text-white px-4 py-2 rounded"
          disabled={loading}
        >
          {loading ? 'Adding...' : 'Add Drill'}
        </button>
      </form>
    </div>
  );
}
